  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Geological Survey Western Region
  Coastal and Marine Geology Team deployed the National Institute of Water and Atmospheric
  Research (New Zealand) three (NIWA) Dobie-A non-directional wave gauges in nearshore
  areas of western Maui during October 2003 - February 2004 in depths less than 11
  m. It also provides tidal heights, although they are not linked to a shore-based
  datum. These data were collected to provide research-grade scientific baseline measurements
  and for nearshore circulation studies. Data are in ASCII format with included metadata
  as .doc and .txt files.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
